import React from 'react'
import {Switch, Link} from 'react-router-dom'


const Product = ({id, name, source, product_info, price, color, count}) => {
    
    return(
        <div className="project-page">
            <h3>{id}</h3>
            <h3>{name}</h3>
            <h3>{source}</h3>
            <h3>{product_info}</h3>
            <h3>{price}</h3>
            <h3>{color}</h3>
            <h3>{count}</h3>
        </div>
    );
}
export default Product
